import styled from 'styled-components';

export const Wrapper = styled.div`
  width: 100%;
  height: 99vh;
  margin: 0;
  padding: 0;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
  background-color: ${({ theme }) => theme.colors.lightGrey};

`;
